    public class QueueListener
    {
        private ActiveMQHandler.ActiveMQListener _activeMQListener;

        public QueueListener()
        {
        }

        public void StartListen(int maximumConcurrency)
        {
            _activeMQListener = new ActiveMQListener(
                        System.Configuration.ConfigurationManager.AppSettings["ActiveMQURL"],
                        System.Configuration.ConfigurationManager.AppSettings["ActiveMQRQ"]);

            _activeMQListener.OnMessageArrived += OnMessageArrived;
            _activeMQListener.StartListen("", maximumConcurrency);
        }

        public void StopListen()
        {
            _activeMQListener.Close();
            _activeMQListener.OnMessageArrived -= OnMessageArrived;
        }
           
        private void OnMessageArrived(Tuple<string, string, TimeSpan> tMessage)
        {
            int sleepTime = int.Parse(System.Configuration.ConfigurationManager.AppSettings["SleepTime"]); 

            if (sleepTime > 0)
            {
               if(System.Configuration.ConfigurationManager.AppSettings["RandomSleepTime"] == "true")
               {
                   sleepTime = new Random().Next(10, sleepTime); 
               }  
               Thread.Sleep(sleepTime);
            }
            System.Diagnostics.Debug.WriteLine(tMessage.Item1 + "at " + tMessage.Item3.ToString("hhmmssfff"));
            WriteResponseToQueue(tMessage.Item1);
        }

        private void WriteResponseToQueue(string id)    
        {
            //Task.Factory.StartNew(() =>
            //    {
                    ActiveMQWriter w = new ActiveMQWriter(System.Configuration.ConfigurationManager.AppSettings["ActiveMQURL"], 
                        System.Configuration.ConfigurationManager.AppSettings["ActiveMQRS"]);
                    w.WriteMessageToQueue(ResponseMessage, id, false);
            //    });
        }

